  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai National
  Moose Range outlines Refuge accomplishments from September through December of 1959.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, raptors, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  collections and receipts, vegetation control, and wildfires. Resource management
  is outlined; topics include fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, and hunting.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
